import React from "react";
import Burger from "../../image/BurgerKing.jpg";
import { Card, CardDeck, ListGroup, ListGroupItem } from "react-bootstrap";
import { IoMdShareAlt } from "react-icons/io";
import { MdRateReview } from "react-icons/md";

const ProjectSummary = () => {
  return (
    <Card style={{ width: "40rem" ,margin:'0 0 10px 0' }}>
      <Card.Img variant="top" src={Burger} style={{ width:"45rem", height:"23rem"}} />
      <Card.Body>
        <Card.Title>Burker King - The Bright Mall</Card.Title>
        <Card.Text>
          Address: The Bright mall 15/9 Rama2 Rd,, Thakam, Bangkhunthain,,
          Bangkok 10150
        </Card.Text>
      </Card.Body>
      <ListGroup className="list-group-flush">
        <ListGroupItem>Hours: Open 24 hours</ListGroupItem>
        <ListGroupItem>$$ - Fast food restaurant</ListGroupItem>
        <ListGroupItem>Phone: 02 365 6999</ListGroupItem>
      </ListGroup>
      <Card.Body>
        <Card.Link href="#">
          <MdRateReview /> Write Review
        </Card.Link>
        <Card.Link href="#">
          <IoMdShareAlt /> Share
        </Card.Link>
      </Card.Body>
      <Card.Footer>
        <small className="text-muted">Last updated 3 mins ago</small>
      </Card.Footer>
    </Card>
  );
};
export default ProjectSummary;
